package com.qyc.service.impl;import com.baomidou.mybatisplus.core.conditions.query.QueryWrapper;import com.baomidou.mybatisplus.extension.service.impl.ServiceImpl;import com.entity.Warehouse;import com.qyc.mapper.WarehouseMapper;import com.qyc.service.WarehouseService;import org.springframework.beans.factory.annotation.Autowired;import org.springframework.stereotype.Service;import java.util.List;@Servicepublic class WarehouseServiceImpl extends ServiceImpl<WarehouseMapper, Warehouse> implements WarehouseService {    @Override    public List<Warehouse> selectAllPlusSql() {        QueryWrapper wrapper = new QueryWrapper();        List<Warehouse> list = baseMapper.selectList(wrapper);        return list;    }    @Autowired    private WarehouseMapper warehouseMapper;    @Override    public List<Warehouse> selectAllMySql() {        List<Warehouse> list = warehouseMapper.selectAllMySql();        return list;    }}